import React from 'react';
import './Home.css';

export default function Home() {
  return (
    <div className="home">
      {/* Title */}
      <h1 className="home__title">FLIP N MATCH</h1>

      {/* Decorative icons row (placeholders) */}
      <div className="home__icons">
        <div className="home__icon home__icon--placeholder" />
        <div className="home__icon home__icon--placeholder" />
        <div className="home__icon home__icon--placeholder" />
        <div className="home__icon home__icon--placeholder" />
      </div>

      {/* Difficulty cards row (placeholders) */}
      <div className="home__cards">
        <div className="home__card home__card--placeholder" />
        <div className="home__card home__card--placeholder" />
        <div className="home__card home__card--placeholder" />
      </div>

      {/* Brick ground placeholder */}
      <div className="home__ground home__ground--placeholder" />
    </div>
  );
}
